lens_3.query:
q = load "${App.Datasets.CG_OrderItem5_tp.FullyQualifiedName}";
q = group q by ('Order_ActivatedDate_Year', 'Order_ActivatedDate_Month');
q = foreach q generate 'Order_ActivatedDate_Year' + "-" + 'Order_ActivatedDate_Month' as 'Order_ActivatedDate_Year-Order_ActivatedDate_Month', sum('TotalPrice') as 'Sales', sum('Quantity') as 'Quantity';
q = order q by 'Order_ActivatedDate_Year-Order_ActivatedDate_Month' asc;
q = limit q 2000;

